const Discord = require('discord.js');
var rpcEmotes = ["🌑", "📃", "✂️"];
var interval;
var emojiTimerRe = 0;
var mainMessage;

var embedTemplate = new Discord.MessageEmbed({
    color: 0x0000FF,
    author: {
        name: member.user.username,
        icon_url: member.user.displayAvatarURL()
    },
    title: "Papier, Kamień, Nożyce",
    description: `Kamień (${rpcEmotes[0]}), Papier (${rpcEmotes[1]}), Nożyce (${rpcEmotes[2]})?\n\nDodaj rekacje masz na to 1 min.`,
    timestamp: new Date(),
});

msg.channel.send(embedTemplate).then(async (message) => {
    mainMessage = message;
    interval = setInterval(function() {
        emojiTimerInt(message, rpcEmotes);
    }, 500)

})

function emojiTimerInt(message, subarray) {
    message.react(subarray[emojiTimerRe]);
    emojiTimerRe += 1;

    if (emojiTimerRe == subarray.length) {
        clearInterval(interval);

        message.awaitReactions((reaction, user) => rpcEmotes.includes(reaction.emoji.name) && user.id == msg.author.id, {
                time: 60000,
                errors:['time'],
                max:1
            })
            .then((collected) => {
                var emojiReacted = collected.first()["emoji"];
                var emojiBot = rpcEmotes[Math.floor(Math.random() * rpcEmotes.length)];

                var rpcList = [emojiBot,emojiReacted["name"]];

                if (rpcList.includes(rpcEmotes[0]) && rpcList.includes(rpcEmotes[1])) { // Kamień + Nożyce
                    if (emojiBot == rpcEmotes[0]) {
                        win(emojiBot,emojiReacted["name"]);
                    } else {
                        lose(emojiBot,emojiReacted["name"]);
                    }
                } else if (rpcList.includes(rpcEmotes[1]) && rpcList.includes(rpcEmotes[2])) { // Papier + Nożyce
                    if (emojiBot == rpcEmotes[1]) {
                        win(emojiBot,emojiReacted["name"]);
                    } else {
                        lose(emojiBot,emojiReacted["name"]);
                    }
                } else if (rpcList.includes(rpcEmotes[2]) && rpcList.includes(rpcEmotes[0])) { // Nożyce + Kamień
                    if (emojiBot == rpcEmotes[2]) {
                        win(emojiBot,emojiReacted["name"]);
                    } else {
                        lose(emojiBot,emojiReacted["name"]);
                    }
                } else { // Tie
                    tie(emojiBot,emojiReacted["name"]);
                }
            })
            .catch((error) => {
                var errorEmbed = new Discord.MessageEmbed({
                    color: 0xFF0000,
                    author: {
                        name: member.user.username,
                        icon_url: member.user.displayAvatarURL
                    },
                    title: "Kamień Papier Nożyce",
                    description: "Nie zareagowałeś na czas!",
                    timestamp: new Date(),
                });

                msg.channel.send(errorEmbed);
            });
    }
}

function win(botOption, playerOption) {
    embedTemplate["description"] = `Kamień (${rpcEmotes[0]}), Papier (${rpcEmotes[1]}), Nożyce (${rpcEmotes[2]})?\n\nBot wybrał ${botOption}\nTy wybrałeś ${playerOption}\n\nWygrałeś!`;
    embedTemplate["color"] = 0x00FF00;
    mainMessage.edit(embedTemplate);
}

function lose(botOption, playerOption) {
    embedTemplate["description"] = `Kamień (${rpcEmotes[0]}), Papier (${rpcEmotes[1]}), Nożyce (${rpcEmotes[2]})?\n\nBot wybrał ${botOption}\nTy wybrałeś ${playerOption}\n\nPrzegrałeś!`;
    embedTemplate["color"] = 0xFF0000;
    mainMessage.edit(embedTemplate)
}

function tie(botOption, playerOption) {
    embedTemplate["description"] = `Kamień (${rpcEmotes[0]}), Papier (${rpcEmotes[1]}), Nożyce (${rpcEmotes[2]})?\n\nBot wybrał ${botOption}\nTy wybrałeś ${playerOption}\n\nRemis!`;
    embedTemplate["color"] = 0xFFFF00;
    mainMessage.edit(embedTemplate)
}

